    return (
        <Container isVisible={menuIsVisible}>
            <a onClick={() => setMenuIsVisible(false)}><img src={mobileMenuClose} size={35}/></a>
            {/* <a href="#" onClick={() => setMenuIsVisible(false)}>X</a> */}
            <nav>
                <a href="#">Notícias</a>
                <a href="#">Tratamentos</a>
                <a href="#">Produtos</a>
                <a href="#">Soluções Cannect</a>
            </nav>
        </Container>
    )
}
